def get_bit_stream_from_RF(d: RfCat):
    '''
    just sit and dump packets as they come in
    kinda like discover() but without changing any of the communications settings
    '''

    # d.RFxmit(b"\x5F\xBF\x23\xB4\xC3\xEB\xF3\xE5\x02\x98", repeat=10)
    # d.discover(length=240)
    # d.discover()
    # return
    print("Entering RFlisten mode...  packets arriving will be displayed on the screen")
    print("(press Enter to stop)")
    received_hex = []

    while not keystop():
        bit_stream_list = []
        while True:
            try:
                # y, t = d.RFrecv(blocksize=30)
                # print("(%5.3f) Received:  %s  | %s" % (t, hexlify(y).decode(), makeFriendlyAscii(y)))
                y, t = d.RFrecv(blocksize=240)
                yhex = binascii.hexlify(y).decode()
                # binary_string = binascii.unhexlify(yhex)
                bit_stream = bin(int(yhex, 16))[2:]
                count_1s = len([bit for bit in bit_stream if bit == "1"])
                if count_1s / len(bit_stream) <= 0.8:
                    print("(%5.3f) received:  %s | %s" % (t, yhex, bit_stream))
                    bit_stream_list.append(bit_stream)
                else:
                    if len(bit_stream_list) >= 6:
                        bit_stream_list.append(bit_stream)
                        break
                    else:
                        bit_stream_list = [bit_stream]
                        # print("(%5.3f) discarded:  %s | %s" % (t, yhex, bit_stream))

            except ChipconUsbTimeoutException:
                bit_stream_list = []
            except KeyboardInterrupt:
                print("Please press <enter> to stop")
                sys.stdin.read(1)

        bit_stream = ''.join(bit_stream_list)
        if False:
            # bit_stream_list = bit_stream.split('00000001111111')
            bit_stream_list = bit_stream.split('0000000' * SAMPLES_PER_BIT + '1111111' * SAMPLES_PER_BIT)
            for bit_stream in bit_stream_list:
                print(bit_stream)
            # print(bit_stream_list)
        if False:
            base_pos = bit_stream.index('0000')
            base_pos2 = bit_stream.index('00000001111111')
            print(bit_stream)
            print(bit_stream[:base_pos])
            print(bit_stream[base_pos:base_pos2])
            print(bit_stream[base_pos2:])

        return bit_stream


