def convert_to_binary(received_bit_counts_no_round):
    converted_bits = []
    if received_bit_counts_no_round[0] >= 0.75 * PREAMBLE_BITS:
        converted_bits.append('<')
    res = list(zip(received_bit_counts_no_round[1:], received_bit_counts_no_round[2:]))
    res = [res[pos] for pos in range(len(res)) if pos % 2 == 0]
    # res = [(received_bit_counts_no_round[pos], received_bit_counts_no_round[pos+1]) for pos in range(len(received_bit_counts_no_round)) if pos % 2 == 0]

    for pair in res:
        # if pair == (-4, 2):
        if -5.5 <= pair[0] <= -3 and 0.5 <= pair[1] <= 3:
            converted_bits.append('0')
        # elif pair == (-1, 5):
        elif -2 <= pair[0] <= -0.5 and 4 <= pair[1] <= 5.5:
            converted_bits.append('1')
        else:
            converted_bits.append('?')
    converted_bits.append('>')

    return converted_bits


